// components/Services.js
import React from 'react';
import { Link, Routes, Route } from 'react-router-dom';

const Services = () => {
  return (
    <div>
      <h2>Our Services</h2>
      <ul>
        <li><Link to="design">Music Design</Link></li>
        <li><Link to="development">Music Development</Link></li>
      </ul>

      <Routes>
        <Route path="design" element={<div>Details about Music Design.</div>} />
        <Route path="development" element={<div>Details about Music Development.</div>} />
      </Routes>
    </div>
  );
};

export default Services;
